import React from "react";
import '../styles/Button.css';

export default props => {

let CLASS = 'button'

CLASS += props.operation ? 'operation' : ''
CLASS += props.double ? 'double' : ''
CLASS += props.triple ? 'triple' : ''

return(<button
    className={CLASS}
    onClick={() => props.click()} >
    {props.label}
</button>)
}
